{''info'':{''cohort_id'':''74'',''cohort_name'':''ColoCare Consortium '',''cohort_acronym'':''ColoCare'',''update_time'':''2017-10-26T04:00:00.000Z'',''collab_name'':''Jennifer Ose'',''collab_position'':''Scientific Coordinator'',''collab_phone'':''8012135762'',''collab_email'':''jennifer.ose@hci.utah.edu'',''pi_name_1'':''Neli Ulrich'',''pi_name_2'':''Jane Figueiredo'',''pi_name_3'':''Erin Siegel / David Shibata'',''pi_name_4'':''Christopher Li'',''pi_name_5'':''Alexis Ulrich'',''pi_name_6'':''Graham Colditz '',''pi_institution_1'':''Huntsman Cancer Institute'',''pi_institution_2'':''Cedars-Sinai Medical Hospital'',''pi_institution_3'':''Moffitt Cancer Center / University of Tennessee'',''pi_institution_4'':''Fred Hutchinson Cancer Research Center'',''pi_institution_5'':''University Hospital Heidelberg'',''pi_institution_6'':''Washington University- St. Louis'',''cohort_web_site'':''https://healthcare.utah.edu/huntsmancancerinstitute/clinical-trials/colocare-consortium.php'',''cohort_description'':''The ColoCare Study is a prospective cohort of men and women diagnosed with primary invasive colorectal cancer (CRC, stages I-IV), with primary outcomes including quality-of-life, recurrence, and death. It is the only CRC cohort that includes the collection of clinical and risk factor data and the sampling of a diverse panel of biospecimens at multiple critical time points (prior to surgery and at 3, 6, 12, 24, 36, 48 and 60 months post-surgery). This unique design with repeat assessments enables innovative research into the influence of lifestyle/behavioral factors on patient outcomes; ethnic/racial disparities in clinical outcomes; the discovery and validation of novel biomarkers from blood, urine and stool useful for guiding treatment decision-making and risk prediction; and interactions between treatment, risk factors, and biomarkers on clinical outcomes. ColoCare was initiated at the Fred Hutchinson Cancer Research Center (FHCRC) with subsequent consortium sites at the Moffitt Cancer Center (Moffitt), German Cancer Research Center (Heidelberg, HBG), and Huntsman Cancer Institute (HCI) with predominantly institutional start-up funding for patient recruitment. Currently, n=1,600 patients have been recruited. ColoCare has successfully launched research on biologic determinants of CRC (e.g., tumor immunity, gut microbiome, epigenome), health behaviors (e.g., physical activity, adipose tissue distribution), clinical endpoints (e.g., surgical complications), as well as interrelations between these factors in the context of CRC prognosis. To accelerate patient accrual and the greater inclusion of under-represented minority participants, we propose to nearly tripple our current sample size n=5,000 patients, further enhance our data/biospecimen collection at all US sites and include two new sites with high volume of minority populations. In addition, to expand our ability to study energy balance, tumor heterogeneity, and long-term outcomes, we propose additional efforts dedicated to data collection and follow-up. Each ColoCare Study site will leverage existing infrastructure, including access to NCI comprehensive/designated cancer center cores, while utilizing well-established and consistently applied recruitment, data, and biospecimen collection protocols. Patients will be followed up both actively and passively by study staff (in-person and through medical record reviews), as well as via linkages to cancer registry and vital status records. With this infrastructure grant, we propose several steps to maintain, augment, and diversify ColoCares unique and valuable resources to advance an unparalleled research agenda.

