{''info '':{''cohort_id'':''20'',''cohort_name'':''Canadian Study of Diet, Lifestyle and Health'',''cohort_acronym'':''CSDLH'',''update_time'':''2017-06-27T04:00:00.000Z'',''collab_name'':''Thomas Rohan'',''collab_position'':''Principal Investigator'',''collab_phone'':''718-430-3355'',''collab_email'':''thomas.rohan@einstein.yu.edu'',''pi_name_1'':'''',''pi_name_2'':'''',''pi_name_3'':'''',''pi_name_4'':'''',''pi_name_5'':'''',''pi_name_6'':'''',''pi_institution_1'':'''',''pi_institution_2'':'''',''pi_institution_3'':'''',''pi_institution_4'':'''',''pi_institution_5'':'''',''pi_institution_6'':'''',''cohort_web_site'':''https://www.maelstrom-research.org/mica/individual-study/csdlh#/'',''cohort_description'':''
The purpose of the Canadian Study of Diet, Lifestyle, and Health is to investigate the relationship between diet, lifestyle factors, molecular markers, and cancer incidence in Canada. The cohort was established predominantly by recruiting alumni from the Universities of Alberta, Toronto, and Western Ontario between 1995 and 1998, but also includes a small contingent recruited mostly in 1992 through the Canadian Cancer Society. At enrollment, participants completed lifestyle and food frequency questionnaires, measured waist and hip circumferences, and provided hair and toenail specimens. The study recruited 73,909 individuals (34,291 males and 39,618 females), of whom 97 percent provided biological specimens. The mean (standard deviation) ages of the male and female participants at recruitment were 51.6 (15.6) and 46.1 (15.2) years, respectively. Follow up of the cohort will be performed by record linkage to the Canadian Cancer Registry.'',''request_procedures_web_url'':'''',''attachments'':{}},''state'':{''hasMounted'':true,''cohort_id'':''20'',''info'':{''cohort_id'':''20'',''cohort_name'':''Canadian Study of Diet, Lifestyle and Health'',''cohort_acronym'':''CSDLH'',''update_time'':''2017-06-27T04:00:00.000Z'',''collab_name'':''Thomas Rohan'',''collab_position'':''Principal Investigator'',''collab_phone'':''718-430-3355'',''collab_email'':''thomas.rohan@einstein.yu.edu'',''pi_name_1'':'''',''pi_name_2'':'''',''pi_name_3'':'''',''pi_name_4'':'''',''pi_name_5'':'''',''pi_name_6'':'''',''pi_institution_1'':'''',''pi_institution_2'':'''',''pi_institution_3'':'''',''pi_institution_4'':'''',''pi_institution_5'':'''',''pi_institution_6'':'''',''cohort_web_site'':''https://www.maelstrom-research.org/mica/individual-study/csdlh#/'',''cohort_description'':''
